import  React,{ useEffect,useState }from "react";
import { MapContainer, useMapEvents,TileLayer, Marker, Popup ,Polyline} from 'react-leaflet';
//import {useSelector,useDispatch} from 'react-redux';
//import {endPart,showMarkers,incrementDifference} from '../actions/actions';
//import {haversineDistance}from '../util/drawData.js';
import Calendar from './Calendar';
import seats from '../data/seats';
import parkings from '../data/prkings';

const limeOptions = { color: 'red' }
const Map=()=>{
    return(
        <MapContainer 
        center={[ 24.791658318888238,46.74198403820229 ]}
         zoom={20} 
         scrollWheelZoom={false} 
         style={{width: '890px', height: '700px'}}
        > 
            <TileLayer
                attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
                url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
            />
        {seats.map(seat=>{
            return <Marker position={[seat.coordinates[1],seat.coordinates[0]]}>
                <Popup style={{ height:"400px"}}>
                    <Calendar/>
                </Popup>
            </Marker>
        })    
        }

        </MapContainer>

    );
}
export default Map;
